import React from 'react';

import TitleScreen from './TitleScreen.js';


const rem = [<TitleScreen changeRem={changeRem}/>, <div></div>];
let currentRem = 0;

function changeRem(newRem){
    currentRem = newRem;
}

function FlashMath(){
    return (
        <>
            {rem[currentRem]}
        </>
    )
}

export default FlashMath;
